import { FETCH_USER_SUCCESS} from "../actions/types";

const initialState = {
};

export default function(state = initialState, action) {
  switch (action.type) {
      case FETCH_USER_SUCCESS:
        return {
            payload: action.payload
        }
    default:
        state
  }
}
